$(window).load(function(){if(null!=localStorage.videos){var e=JSON.parse(localStorage.videos);for(i=0;i!=e.length;i++){var t=$("input[type='checkbox'][value='"+e[i]+"']");t.attr("checked","checked")}}}),$(".randomVid").click(function(){var e=$("input:checkbox:checked").map(function(){return this.value}).toArray(),t=e[Math.floor(Math.random()*e.length)];null!=t?($("#painshake").text(t),$("body").attr("class","result")):$("body").attr("class","error"),localStorage.videos=JSON.stringify(e)}),$(".reset").click(function(){$("body").attr("class","choose")}),$("#selectall").change(function(){$("input").prop("checked",$(this).prop("checked"))});